from collections import Counter


class TopVotedCandidate(object):

    def __init__(self, persons, times):
        """
        :type persons: List[int]
        :type times: List[int]
        """
        self.times = times
        self.persons = persons
        votes = []
        counter = Counter([])
        for p in persons:
            counter.update([p])
            last_max = 0
            arr = []
            for common_p in counter.most_common():
                if common_p[1] >= last_max:
                    arr.append(common_p)
                    last_max = common_p[1]
                else:
                    break
            vote = arr[0][0]
            if len(arr) > 1:
                a = False
                for c in arr:
                    if c[0] == p:
                        a = True
                        vote = p
                        break
                if not a:
                    vote = votes[-1]
            votes.append(vote)
        self.votes = votes

    def q(self, t):
        """
        :type t: int
        :rtype: int
        """

    def b_search(self, arr, left, right, target):
        if right >= 1:
            mid = int(left + (right - left) / 2)
            if (arr[mid - 1] <= arr[mid] < arr[mid + 1]) and (right - left == 2):
                return mid - 1
            elif arr[mid] > target:
                return self.b_search(arr, left, mid - 1, target)
            else:
                return self.b_search(arr, mid + 1, right, target)
        else:
            return -1




